import React from 'react'
import { GU, useViewport } from '@1hive/1hive-ui'
import HomeChart from '../LineChart/HomeChart'

const MyWallet = React.memo(() => {
  const { vw } = useViewport()
  return (
    <div
      css={`
        display: flex;
        flex-direction: row;
        padding-top: ${3 * GU}px;
        padding: 20px;
      `}
    >
      <div
        css={`
          display: flex;
          flex-direction: column;
          justify-content: center;
          width: 20%;
        `}
      >
        <span>Net Value</span>
        <span>$10,000</span>
      </div>
      <HomeChart height={GU * 15.75} width={vw} />
    </div>
  )
})

export default MyWallet
